import React, { Component } from 'react'

export default class Historia extends Component {
    render() {
        return (
             <div className="carousel-item col-3 m-0 p-1">
             <div className="card bg-dark text-white border-0 historia text-white bg-dark">
                 <img className="card-img img-fluid center-block" src="https://cdn.colombia.com/sdi/2019/09/12/sensuales-fotos-de-exsenorita-colombia-para-soho-768478.jpg" alt="" />
                 <div className="card-img-overlay">
                     <h5 className="card-title">Card title</h5>
                     <p className="card-text">This is a wider card with supporting text below as a natural lead-in to additional content. This content is a little bit longer.</p>
                     <p className="card-text">Last updated 3 mins ago</p>
                 </div>
             </div>
         </div>
        )
    }
}
